import c from './Profile.module.css';
import React from 'react';
import MyPosts from './myPosts/MyPosts';

const Profile = (props) => {

    let myPostsElements = props.profilePage.myPostsData.map(
        p => <MyPosts title={p.title} text={p.text} likes={p.likes} dislikes={p.dislikes} />
    );

    return (
        <div className={c.Profile}>
            <img src="https://trashbox.ru/ifiles/220798_004e6a_img_20140503_122504.jpg_min1/avatarki.-1.jpg" className={c.Avatar} />
            <div className={c.Info}>
                <h4>Username</h4><hr />
                <p>Любимый клуб</p>
                <p>Количество постов</p>
                <p>Рейтинг</p>
            </div>
            <div className={c.MyPosts}>
                <h3>Посты пользователя</h3>
                <button onClick={() => {javascript:document.location.href="/profile/addpost"}}>Добавить пост</button><hr />
                {myPostsElements}
            </div>
        </div>
    );
}

export default Profile;
